import './App.css';
import React from 'react';
import ReactDOM from 'react-dom';

import tick from "./RenderingElement";



const root = ReactDOM.createRoot(
    document.getElementById('root')
);

function App() {


  return (
      setInterval(tick(root), 1000)
);

}


export default App;
